πρὸς τὴν θεὸν καὶ δεῖξον ὡς ἄνευ πόνου πολλὴν ὁδὸν περαίνεις Ἴακχε φιλοχορευτά συμπρόπεμπέ με σὺ γὰρ κατεσχίσω μὲν ἐπὶ γέλωτι κἀπ εὐτελείᾳ τόδε τὸ σανδαλίσκον καὶ τὸ ῥάκος κἀξηῦρες ὥστ ἀζημίους παίζειν τε καὶ χορεύειν Ἴακχε φιλοχορευτά συμπρόπεμπέ με καὶ γὰρ παραβλέψας τι μειρακίσκης νυνδὴ κατεῖδον καὶ μάλ εὐπροσώπου συμπαιστρίας χιτωνίου παραρραγέντος τιτθίον προκύψαν Ἴακχε φιλοχορευτά συμπρόπεμπέ με ἐγὼ δ ἀεί πως φιλακόλουθός εἰμι καὶ μετ αὐτῆς παίζων χορεύειν βούλομαι κἄγωγε πρός βούλεσθε δῆτα κοινῇ σκώψωμεν Ἀρχέδημον ὃς ἑπτέτης ὢν οὐκ ἔφυσε φράτερας νυνὶ δὲ δημαγωγεῖ ἐν τοῖς ἄνω νεκροῖσι κἄστιν τὰ πρῶτα τῆς ἐκεῖ μοχθηρίας τὸν Κλεισθένους δ ἀκούω ἐν ταῖς ταφαῖσι πρωκτὸν τίλλειν ἑταῖρες τὰ γνάθα καὶ κακλὰ καὶ κράτησιν ἀκοδετεῖσκεικυφὶς καὶ τὸ τροφεῖον ὄρεσθαι

